import React, { Component } from "react";

class Skills extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <form onSubmit={this.props.setSkills} >
          <label>
            Heading :
            <input type="text"/>
          </label>
          <label>
            Skills :
            <input type="text"/>
          </label>
        </form>
      </div>
    );
  }
}

export default Skills;
